import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar"; // Navbar-ul cu link-uri
import BooksList from "./pages/BooksList";
import AddBook from "./pages/AddBook";
import EditBook from "./pages/EditBook";
import Users from "./pages/Users";       // Pagina utilizatori
import Loans from "./pages/Loans";       // Pagina împrumuturi
import "./styles/library.css";           // Stiluri generale

export default function App() {
  return (
    <BrowserRouter>
      <Navbar /> {/* Navbar apare pe toate paginile */}
      <Routes>
        <Route path="/" element={<BooksList />} />
        <Route path="/books" element={<BooksList />} />
        <Route path="/add-book" element={<AddBook />} />
        <Route path="/edit-book/:id" element={<EditBook />} />
        <Route path="/users" element={<Users />} />
        <Route path="/loans" element={<Loans />} />
        <Route path="*" element={<BooksList />} /> {/* fallback */}
      </Routes>
    </BrowserRouter>
  );
}
